pragma solidity 0.5.0;

import './judge_interface.sol' ;
import './bet.sol' ;
import "./oraclizeAPI.sol";


contract Simple_Judge is Judge, usingOraclize {

  uint public dieselPriceUSD;

  event LogNewDieselPrice(string price);
  event LogNewOraclizeQuery(string description);

  function castVote(Bet bet_contract) external returns (Vote vote) {
    vote = Vote.Hung;
    //uint uvote = vote;//send enum as uint to avoid conversion error
    bet_contract.castVote(uint(vote));
    return vote;
  }



  function __callback(bytes32 myid, string memory result) public {
    require(msg.sender == oraclize_cbAddress());
    emit LogNewDieselPrice(result);
    dieselPriceUSD = parseInt(result, 2); // Let's save it as cents...
        // Now do something with the USD Diesel price...
    }

  function update() public payable {
    emit LogNewOraclizeQuery("Oraclize query was sent, standing by for the answer...");
    oraclize_query("URL",
		   "xml(https://www.fueleconomy.gov/ws/rest/fuelprices).fuelPrices.diesel");
  }
}
